package factoid

import (
	"encoding/hex"

	"github.com/PaulSnow/factom2d/common/constants"
	"github.com/PaulSnow/factom2d/common/interfaces"
)

func GetGenesisFBlock(netID uint32) interfaces.IFBlock {
	block := new(FBlock)
	var data []byte
	var err error
	switch netID {
	case constants.MAIN_NETWORK_ID:
		data, err = hex.DecodeString(MainGenesisBlockStr)
	case constants.TEST_NETWORK_ID:
		data, err = hex.DecodeString(TestGenesisBlockStr)
	default:
		data, err = hex.DecodeString(LocalGenesisBlockStr)
	}

	if err != nil {
		panic(err)
	}
	err = block.UnmarshalBinary(data)
	//block.SetExchRate(10000)
	block.GetBodyMR()
	if err != nil {
		panic(err)
	}
	return block
}

